function storeReducer() {

  const initialState = [
    {
      id: 1,
      name: 'canceled'
    },
    {
      id: 2,
      name: 'draft'
    },
    {
      id: 3,
      name: 'with pickup'
    },
    {
      id: 4,
      name: 'printed'
    }
  ]

}

export default storeReducer(state = initialState);
